import React, {Component} from 'react';
import NumberButton from './numberButton';

class NumberPanel extends Component {


    render() {
        return (
            <div>
                <div>

                </div>
            <div>
                <NumberButton name="1"/>
                <NumberButton name="2"/>
                <NumberButton name="3"/>
            </div>
            <div>
                <NumberButton name="4"/>
                <NumberButton name="5"/>
                <NumberButton name="6"/>
            </div>
            <div>
                <NumberButton name="7"/>
                <NumberButton name="8"/>
                <NumberButton name="9"/>
            </div>
        </div>
        );
    }
}

export default NumberPanel;
